import React from 'react';
import Stripe from '../Stripe';
import '../styles/Media.css';

const Media = () => {
    return(
        <div>
            <Stripe title="Media" description="Learn more about corporate sustainability"></Stripe>
            <div style={{direction:"flex", flexDirection:"row"}}>
                <p>In today's world, it's more important than ever for companies to prioritize sustainable practices.</p>

            </div>
        </div>
    );
};

export default Media;
